using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Struktury
{
    internal class Program
    {
        struct Student
        {
            public string imie;
            public string nazwisko;
            public int wiek;
            public double sredniaOcen;
        }
        static void Main(string[] args)
        {
            Student[] student = new Student[5];
            int decyzja;
            do
            {
                Console.Clear();
                Console.WriteLine("1. Dodawanie studentów do bazy");
                Console.WriteLine("2. Wyświetlanie studentów");
                Console.WriteLine("3. Wyszukiwanie studenta");
                Console.WriteLine("4. Zakończenie programu");
                Console.Write("Twój wybór: ");
                decyzja = int.Parse(Console.ReadLine());
                Console.Clear();
                switch (decyzja)
                {
                    case 1:
                        for (int i = 0; i < student.Length; i++)
                        {
                            Console.WriteLine($"Student {i + 1}:");
                            Console.Write("Imię: ");
                            student[i].imie = Console.ReadLine();
                            Console.Write("Nazwisko: ");
                            student[i].nazwisko = Console.ReadLine();
                            Console.Write("Wiek: ");
                            student[i].wiek = int.Parse(Console.ReadLine());
                            Console.Write("Średnia ocen: ");
                            student[i].sredniaOcen = double.Parse(Console.ReadLine());
                        }
                        break;

                    case 2:
                        Console.WriteLine("Nasi studenci:");
                        for (int i = 0; i < student.Length; i++)
                        {
                            Console.WriteLine($"{student[i].imie} {student[i].nazwisko}, " +
                                $"wiek: {student[i].wiek}, średnia ocen: {student[i].sredniaOcen}");
                        }
                        Console.ReadKey();
                        break;
                    case 3:
                        string imieDoWyszukania;

                        Console.Write("Podaj imię szukanego studenta: ");
                        imieDoWyszukania = Console.ReadLine();

                        break;
                    case 4:
                        Console.WriteLine("\n\n\n\n\n\t\t\t\t\tDziękuję za skorzystanie z programu!");

                        break;
                    default:
                        Console.WriteLine("Wprowadzono niewłaściwą pozycję z menu!");
                        Console.ReadKey();
                        break;
                }

            } while (decyzja != 4 );
            
            System.Threading.Thread.Sleep(1500);

            
        }
    }
}

