using System;

namespace ConsoleApp22
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int[] numbers = new int[30];
            int indent = 1;
            int maximumNumber = 9;

            for (int i = 0; i < numbers.Length; i++)
            {
                numbers[i] = random.Next(maximumNumber + indent);
            }

            Console.Write("Дан массив : ");

            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i]);
            }

            Console.WriteLine();
            Console.Write("Локальные максимумы : ");

            if (numbers[0] > numbers[0 + indent])
            {
                Console.Write(numbers[0]);
            }

            for (int i = 0 + indent; i < numbers.Length - indent; i++)
            {
                if (numbers[i] > numbers[i - indent] && numbers[i] > numbers[i + indent])
                {
                    Console.Write(numbers[i]);
                }
            }

            if (numbers[numbers.Length - indent] > numbers[numbers.Length - indent - indent])
            {
                Console.WriteLine(numbers[numbers.Length - indent]);
            }
        }
    }
}

