import random

NORMAL    = 0
URGENT    = 1
SU_URGENT = 2
MAX_TYPES = 3
MAX_SEPCIALIZATION = 20


def get_valid_int_input(msg , start=None , end =None):
    while True:
        choice = input(msg)
        if not choice.isdecimal() :
            print('Invalid input!!.Try again')
        elif start is not None and end is not None:
            choice = int(choice)
            if choice < start or choice > end:
                print('Invalid range!!.Try again')
            else: return choice
        else:
            return int(choice)


class SpecializationQueue:
    def __init__(self,types_max):
        self.queue = [ [] for i in range(types_max) ]
        self.queue_size = 0

    def __str__(self):
        return '\n'.join(
            [f'Patient: {patient_name} is {["Super urgent" , "urgent" , "Normal"][status]}'\
                         for status , type_lst in enumerate(self.queue) \
                         for patient_name in type_lst]
        )

    def add_patient(self,name ,status):
        if self.queue_size < 10:
            self.queue[-status-1].append(name)  # SU :-3 or 0 , urgent -2 or 1 , normal -1 or 2
            self.queue_size += 1
            return True
        else:
            return False

    def get_next_patient(self):
        for type_lst in self.queue :
            if type_lst:
                self.queue_size -= 1
                return type_lst.pop(0)

        return None

    def remove_patient(self,name):
        for type_lst in self.queue:
            if name in type_lst:
                self.queue_size -=1
                type_lst.remove(name)
                return True

        return None

    def get_size(self):
        return self.queue_size


class HospitalManger:
    def __init__(self , specializations_no):
        self.database = [SpecializationQueue(MAX_TYPES) for i in range(specializations_no)]
        self.max_specialization_size = 10
        self.no_of_patients = 0
    def __str__(self):
        return '\n\n'.join([f'Specialization {idx+1}: There are {spec_size} patients\r\n'
                          f'{str(spec)}'\
                          for idx, spec in enumerate(self.database) if (spec_size:=spec.get_size())])

    def is_specialization_full(self,spec):
        return self.database[spec-1].get_size() >= self.max_specialization_size

    def add_new_patient(self,name,spec,status):
        state = self.database[spec-1].add_patient(name,status)
        self.no_of_patients += state

    def next_patient(self,spec):
        patient = self.database[spec-1].get_next_patient()
        if patient:
            self.no_of_patients -= 1
        return patient

    def patient_remove(self,name , spec):
        patient = self.database[spec-1].remove_patient(name)
        if patient:
            self.no_of_patients -= 1
        return patient


class FrontEndManger:
    def __init__(self,specializations_no = MAX_SEPCIALIZATION):
        self.hospital = HospitalManger(specializations_no)
        self.specializations_no = specializations_no
        self.add_dummy_data()
    def print_menu(self):
        print('\nProgram options:')
        msgs = [
            'Add a new patient',
            'print all patients',
            'Get next patient',
            'Remove a leaving patient',
            'End the program'
        ]
        print('\n'.join([f'{i+1}) {option}' for i , option in enumerate(msgs)]))

        return len(msgs)

    def handle_choice(self,choice):
        if choice == 1:
            spec = get_valid_int_input('Enter the specialization no: ',1,self.specializations_no)
            if not self.hospital.is_specialization_full(spec):
                name = input('Enter patient name: ')
                status = get_valid_int_input('Enter status (0 normal / 1 urgent / 2 super urgent): ',0,2)
                self.hospital.add_new_patient(name,spec,status)
            else:
                print("sorry we can't add more patients for this specialization at this moment")

        elif choice == 2:
            print(self.hospital)

        elif choice == 3:
            spec = get_valid_int_input('Enter the specialization no: ', 1, self.specializations_no)
            if patient_name:= self.hospital.next_patient(spec):
                print(f'{patient_name}, please go with the Dr')
            else:
                print('No patients at the moment. Have rest DR,')

        elif choice == 4:
            spec = get_valid_int_input('Enter the specialization no: ', 1, self.specializations_no)
            name = input('Enter patient name: ')
            if self.hospital.patient_remove(name,spec) is None:
                print('No patient with such name in this specialization!')

    def add_dummy_data(self):
        names = ['Ahmed' , 'Mohamed' , 'Sami' , 'Ibrahim' , 'Islam' , 'Gamal' , 'Zeyad' , 'Ayman' , 'Mostafa' , 'Ali' ]

        for spec in range(random.randrange(self.specializations_no )):
            for i in range(random.randrange(10)):
                self.hospital.add_new_patient(names[random.randrange (len(names)) ], spec+1, random.randrange( SU_URGENT+1))


    def run(self):
        no_choices = self.print_menu()
        while True:
            msg = f'\nEnter your choice from 1 to {no_choices}: '
            choice = get_valid_int_input(msg, 1, no_choices)
            if choice == no_choices:
                break
            self.handle_choice(choice)
            self.print_menu()


if __name__ == '__main__':
    app = FrontEndManger()
    app.run()

